import React from 'react'
import Nav from '../nav'

import styles from './index.module.css'
import { LogoFont } from '../icons'

function Header() {
  return (
    <header className={styles.header}>
      <LogoFont style={{ fontSize: 24 }} />
      <Nav />
    </header>
  )
}

export default Header
